import React, { Component } from "react";
import store from "../api";

export default class MainPage extends Component {
  getStoreData = async () => {
    const { data } = await store.get("/storeItems");
    console.log(data);
  };

  deleteItem = async () => {
    await store.delete("/storeItems/1");
  };

  addItem = async () => {
    const item = {
      count: 300,
      description: "blabla hello",
    };
    await store.post("/storeItems/", item);
  };
  // componentDidMount() {
