  // }

  render() {
    return (
      <div>
        <h1>Welcome to my site</h1>
        <button onClick={this.deleteItem}>Delete first item</button>
        <button onClick={this.getStoreData}>Console log Items</button>
        <button onClick={this.addItem}>Add mock item</button>
      </div>
    );
  }
}
